var resume = $('.resume');
var goToTop = $('#gototop');
    
  $('.nav').click(function(){
    var el = $(this).attr('class').split(' ')[0];
    if($(this).attr('id')==='current'){
        return false;
    }else{
        $('.nav').removeAttr('id');
        $(this).attr('id','current');
        $('.show').hide();
         $('.resume').scrollTop(0);
        $('#'+el).fadeIn(500);
         goToTop.css('opacity','0');
         $('#gototop a').css("cursor","default");
         goToTop.unbind('click');
    }
  });
  
  
  
$('.resume a').click(function(e){
    e.preventDefault();
});  



resume.scroll(function() {
    goToTop.toggleClass('on', resume.scrollTop() >= 200);
    if(resume.scrollTop() >=200){
         goToTop.stop().animate({opacity:1},300);
         $('#gototop a').css("cursor","pointer");
            goToTop.bind('click',function(){
                $('.resume').stop().animate({scrollTop: 0}, 1200);   
            });
    }else{
        goToTop.stop().animate({opacity:0},300);
         $('#gototop a').css("cursor","default");
         goToTop.unbind('click');
    }
});



